ADOBE PHOTOSHOP CS5 TRAINING DVD FOR WINDOWS &amp; MAC (Exercise files included)

Kelby Online Training Photoshop CS5 Power Session

If youre already a Photoshop user and want a quick, convenient way to unlock the potential of Photoshop CS5s new features then this DVD is the place to start. Ideal for people with experience using a previous version of Photoshop (CS4, CS3, or even CS2), the Photoshop CS5 Power Session is the easiest way to learn the new features, tips and shortcuts in Photoshop CS5 so you can start using them right away.

This DVD will teach you:

All about HDR Pro and how Photoshop has now taken over the HDR space
How to speed up your retouching with the new Content Aware Fill option
The all new Camera Raw updates and how noise reduction just got a lot better
Why this is the best Photoshop ever if you need to make complex selections fast
And a ton of tiny tips and changes that simply make Photoshop easier to use.

